import { REGISTER_USER_REQUEST } from "./userActionTypes";

let initialState = {
    loading : false,
    isAuthenticated : false,
    user : {}
};
let userReducer = (state = initialState, action) => {
    let {type, payload} = action;
    switch(type) {
        case REGISTER_USER_REQUEST:
            return {
                ...state
            }
    }
};  


export {userReducer};
